import React from 'react'
import './style.css';
import {useTranslation} from 'react-i18next';

function SearchButton() {
    const{ t, i18n } = useTranslation();
  return (
    <div class="search-button-container">
        <ul>
            <GoogleSearch />
            <LuckySearch />
        </ul>
    </div>
  )
}

const GoogleSearch = () => (
    <li>
        <button class="google-search" type="submit">Google Search</button>
    </li>
);

const LuckySearch = () => (
    <li>
        <button class="lucky-search" type="submit">I'm Feeling Lucky</button>
    </li>
);

export default SearchButton
